__NUXT_JSONP__("/drugs/Lupartumab_Amadotin", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1640972-00-4",chebiId:b,chemicalFormula:b,definition:"An antibody-drug conjugate (ADC) composed of an antibody against a structural homolog of the urokinase-type plasminogen activator receptor (uPAR) and tumor-associated antigen, C4.4a, and conjugated with a cytotoxic agent, with potential antineoplastic activity. Upon intravenous administration, lupartumab amadotin targets and binds to C4.4a-expressing tumor cells. Upon binding and cell entry, the cytotoxic agent kills the tumor cell. C4.4a, a glycolipid-anchored membrane protein and a member of the Ly-6 family, is overexpressed by a variety of cancer cell types whereas it is minimally expressed on healthy cells.",fdaUniiCode:"21970JMA97",identifier:"C116070",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C129823","C1512"],synonyms:["BAY112-9980","BAY1129980","LUPARTUMAB AMADOTIN",c]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FLupartumab_Amadotin",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Lupartumab_Amadotin","","Lupartumab Amadotin","2021-10-30T13:19:02.953Z")));